import React, { Component } from "react";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div
        // style={{
        //   paddingTop: 50,
        //   padding: 50,
        //   paddingBottom: 10,
        // }}
        className="jumbotron jumbotron-fluid bg-dark"
        className="text-right pb-1"
      >
        <div className="container">
          <h5 className="display-4" className="text-left text-white  mt-1">
            Contact Us
          </h5>
          <p className="lead medium" className="text-left text-white pr-5 mt-1">
            Address: street DHA, Lahore <br />
            Phone: 0900 78601 <br />
            Email: abcd@yahoo.com
          </p>
        </div>
      </div>
    );
  }
}

export default Footer;
